export const PLUS = 'PLUS';
export const MINUS = 'MINUS';
export const TIMES = 'TIMES';
export const EQUALS = '=';
export const AC = 'AC';
export const ONE = 1;
export const TWO = 2;
export const THREE = 2;
export const FOUR = 2;
export const FIVE = 2;
export const SIX = 2;
export const SEVEN = 2;
export const EIGHT = 2;
export const NINE = 2;

interface IButtonClick { type: any, payload: { buttonName: any }}

export function buttonClick(buttonName: any): IButtonClick {
  return {
    type: AC,
    payload: {
      buttonName
    }
  }
}

export default buttonClick
